<!DOCTYPE html>
<html data-navbar="navbar.html">
  <head>
    <title></title>
    <link rel="stylesheet" href="/public/style.css">
    <script async src="/public/highlight.min.js"></script>
    <script src="/public/browser.js"></script>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="stylesheet" href="/public/wa-mediabox.min.css">
    <script async src="/public/wa-mediabox.min.js"></script>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta charset="UTF-8">
  </head>
  <body class="tree-body">
    <a name="top" id="top"></a>
    <div class="body-container">
      <header>
        <h1>Dashboard</h1>
        <section id="navigation" class="navigation"></section>
      </header>
      <div class="section-container">
        <section class="full">
          <a name="content" id="content"></a>
          <div class="content">
            <ul id="sitemap" class="desktop"></ul>
            <p><a class="skip" href="#top">Top of page</a></p>
          </div>
        </section>
      </div>
    </div>
    <template id="route-template">
      <li id="route-container-${route.id}">
        <div id="route-children-${route.id}" class="tree" title="${route.urlPath}">
          <a id="link-${route.id}" href="${route.urlPath}"><img data-src="${route.screenshotPath}"> ${route.title}</a>
          <ul id="route-list-${route.id}"></ul>
        </div>
      </li>
    </template>
  </body>
</html>
